import numpy as np


def check_board(board):
    for col in np.transpose(board):
        if sum(col) > 1:
            return False
    
    diags = [np.diag(board, k) for k in range(-len(board) + 1, len(board))]
    
    for diag in diags:
        if sum(diag) > 1:
            return False
    
    cross_diags = [np.diag(np.fliplr(board), k) for k in range(-len(board) + 1, len(board))]

    for diag in cross_diags:
        if sum(diag) > 1:
            return False

    return True

def n_queens(n: int):
    if n == 1:
        return [["Q"]]
    
    rows_avl = list(range(n))
    
    # Use some kind of back tracking

    # Choose row
    # Test if valid
    # Continue or Go back
    # Replace row 

    board = np.zeros(shape = (n, n))
    valid_boards = []

    def backtrack(board):
        if not rows_avl:
            valid_boards.append(board.copy())
            return
        
        row = rows_avl.pop(0)
            
        for col in range(n):
            board[row, col] = 1
            if check_board(board):
                backtrack(board)
            board[row, col] = 0
        
        rows_avl.append(row)

    backtrack(board)

    return valid_boards


def n_queens_sol(n_max = 9):
    sol = {}
    
    for n in range(n_max + 1):
        valid_boards = n_queens(n)
        str_boards = []
        for board in valid_boards:
            str_board = []
            for row in board:
                str_board.append("".join(list(map(lambda x: "Q" if x else ".", row))))
            str_boards.append(str_board)
        sol[n] = str_boards

    return sol

